// CopyScan.js
// Detailed page for copy and scanning services.

import React from 'react';
import { Link } from 'react-router-dom';

const CopyScan = () => {
  return (
    <div className="service-page">
      <h1>Копировальные услуги и сканирование</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/office.png'}
        alt="Копирование и сканирование"
        className="service-page__image"
      />
      <p>
        Предлагаем чёрно‑белое и цветное копирование документов, сканирование
        файлов в высоком разрешении и создание цифровых архивов. Наше
        оборудование обеспечивает точные копии без потери качества.
      </p>
      <p><strong>Стоимость:</strong> от 5 ₽ за страницу.</p>
      <p><strong>Срок исполнения:</strong> от 5 минут.</p>
      <Link to="/services" className="btn btn-primary">
        Вернуться к услугам
      </Link>
    </div>
  );
};

export default CopyScan;
